XXVI - Atividades de acesso a patrimônio genético ou conhecimento tradicional associado para alimentação e agropecuária: Atividades de pesquisa ou desenvolvimento tecnológico realizada sobre amostra de patrimônio genético ou sobre conhecimento tradicional associado visando o desenvolvimento de processo ou produto, incluindo atividades de pesquisa e produção biotecnológicas para produtos alimentares e agroenergia, bem como a comercialização dos produtos, subprodutos e derivados, insumos agrícolas, pecuários, pesqueiros e florestais.
XXV - Agrobiodiversidade: inclui todos os componentes da biodiversidade que têm relevância para a agropecuária, alimentação e produção de energias renováveis, contemplando a variabilidade de animais, plantas e microorganismos, nos níveis genético, de espécies e de ecossistemas, fundamentais para sustentar as funções-chave de agroecossistemas, suas estruturas e seus processos;    
XXVI - Agrobiodiversidade nativa: agrobiodiversidade cujo centro de origem, de diversificação ou de domesticação compreenda área geográfica localizada no território nacional, mar territorial, na plataforma continental e na zona econômica exclusiva incluindo microorganismo isol

EMENDA 

O Artigo 28 passa a vigorar com a seguinte redação, acrescidos os incisos I, II, III e IV: 

Art. 28. Considera-se infração administrativa contra o patrimônio genético ou ao conhecimento tradicional associado toda ação ou omissão que violem as normas desta Lei, assim tipificadas: 

I - acessar o patrimônio genético ou o conhecimento tradicional associado, em desacordo com esta Lei; 

II - remeter amostra de patrimônio genético para o exterior em desacordo com o previsto nesta Lei; 

III - deixar de repartir benefícios de que trata esta Lei; 

IV - omitir do Poder Público informação relevante sobre atividade de acesso ao patrimônio genético ou ao conhecimento tradicional associado por ocasião de auditoria ou fiscalização

Art 1º. Suprima-se o inciso II do Artigo 4º e os Artigos 50, 51, 52 do Projeto de Lei 7.735 de 2014.

Art 2º. Introduz-se o Título I "DAS DISPOSIÇÕES GERAIS" incluindo os Artigos 1º ao artigo 5º do Projeto de Lei 7.735 de 2014.

Art. 3º. Incluam-se e renumerem-se, ao Artigo 1º do Projeto de Lei 7.735 de 2014, os seguintes incisos:

Art. 1º...............................................................................

I - regular o acesso à agrobiodiversidade e a repartição de benefícios decorrentes da exploração econômica de produto ou processo desenvolvido a partir do acesso;

II - regular os direitos de agricultor;

III - conservar a agrobiodiversidade existente no território nacional, na plataforma continental, no mar territorial ou na zona econômica exclusiva;

IV - promover a segurança alimentar;

V - regular a remessa para o exterior de amostras da agrobiodiversidade.

Art. 4º. Inclua-se onde couber no Projeto de Lei 7.735 de 2014 o seguinte Artigo:

Art. º O acesso, a remessa e a repartição de benefícios decorrentes da utilização das espécies incluídas no Sistema Multilateral de Acesso e Repartição de Benefícios, de que trata o Tratado Internacional sobr
